import './Catalog.css';
import sakset from "../kuvat/sakset.jpg"

//Näihin tiedot tietokannasta 
export default function Catalog () {
	return (
    
	<div class="card"> 
        <img src={sakset} alt="sakset" id="sakset"/>
        <h1>Tuote</h1>
        <p><button>Lisätietoja</button></p>
    </div>
);
}
